import { Password } from '@mui/icons-material';
import React, { useState } from 'react'

function SignUp() {
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [password, setPassword] = useState("");
    const [comfirmPassword, setComfirmPassword] = useState("");
  return (
    <div>
        <form action="">
              <input value={firstName} onChange={(e)=>{setFirstName(e.target.value)}} type="text" placeholder="First Name" required /> 
              <input value={lastName} onChange={(e)=>{setLastName(e.target.value)}}  type="text" placeholder="Last Name" required/> 
              <input value={password} onChange={(e)=>{setPassword(e.target.value)}} type="text" placeholder="Password"  required/>
              <input value={comfirmPassword} onChange={(e)=>{setComfirmPassword(e.target.value)}} type="text" placeholder="Comfirm Password" required/>

              <button type='submit'>SignUp</button>
      </form>
    </div>
  )
}

export default SignUp;
